function ImageBox(props){
    if ( props.Grey === "true")
    return(
        <div className="ImageBox maskImage">
            <img  
                src={props.PictureSource} 
                alt={props.PictureAlternateText} 
                style={{zIndex:-1}}
            />
        </div>
    );
}

export default ImageBox;
